import styled from 'styled-components'

const Outer = styled.div`
    height: 100%
    padding-top: 10px;
    padding-bottom: 60px;

    h4 {
        margin-left: 30%;
        margin-top: 50px;
        align: center;
        text-align: center;
        width: 60%;
        word-wrap: break-word;
    }
`
export default Outer
